import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    componentDidMount()
    {
        var arr;
        fetch(raw)
            .then(r => r.text())
            .then(text => {
                const buffer = new String();
                buffer = text;
                console.log('buffer is ', this.buffer);
                arr = this.buffer.split('\n');
                console.log('array is', arr);
                this.setState({ arr });
            });
        
    }

    render()
    {
        return (

            <ul>
                {
                    this.state.listings
                        .map((listing, index) =>
                            <li key={index}>
                                { listing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
